3 Usage of Tracker](#21)\n","     - [4.1.4 How does the frequecy of device use change over time?](#22)\n"," - [4.2 Weight Tracker](#23)\n","     - [4.2.1 Weight of Participants Over the Data Collection Period](#24)\n","     - [4.2.2 Do participants who use the weight function tend to be more active?](#25)\n"," - [4.3 Sleep Tracker](#26)\n","     - [4.3.1 Breakdown of Hours Slept per Night](27)\n","     - [4.3.2 Are the participants who track their sleep more regularly the ones who get less sleep?](#28)\n"," - [4.4 Sleep Vs Activity](#29)\n","* [5.0 Share](#30)\n"," - [5.1 Key Findings](#31)\n"," - [5.2 Further Data Limitations](#32)\n"," - [5.3 Recommendations](#33)\n","* [References](#34)\n","\n"]},{"cell_type":"markdown","id":"558cd282","metadata":{"_cell_guid":"bc2c29ed-938f-4e29-8a4a-c36fe715f0aa","_uuid":"9fd5d3a7-9c71-4200-804b-1fb9153a8014","papermill":{"duration":0.121138,"end_time":"2022-03-07T12:21:12.617195","exception":false,"start_time":"2022-03-07T12:21:12.496057","status":"completed"},"tags":[]},"source":["_____________________\n","\n","<a id=\"1\"></a>\n","\n","\n","## Datasets\n","\n","The following datasets were used for the completion of this project: [Kaggle: FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit)\n","_____________________________________________________________________________________________________________"]},{"cell_type":"markdown","id":"841ee229","metadata":{"_cell_guid":"bc2c29ed-938f-4e29-8a4a-c36fe715f0aa","_uuid":"9fd5d3a7-9c71-4200-804b-1fb9153a8014","papermill":{"duration":0.124321,"end_time":"2022-03-07T12:21:12.862733","exception":false,"start_time":"2022-03-07T12:21:12.738412","status":"completed"},"tags":[]},"source":["<a id=\"2\"></a>\n","## Project Background\n","\n","As part of the Google Professional Data Analytics Certificate, I will be playing the part of a Junior Analyst, focusing on exploring data for Bellabeat, in order to make recommendations for their marketing strategy.\n","\n","Bellabeat, founded in 2013, is a high-tech manufacturer of health-focused products for women, including smart products. Their primary focus is on empowering women with knowledge about their own health and habits. Since its founding, the company has grown significantly, launching a huge online retail platform and opening offices worldwide.\n","The company Cofounder and Chief Creative Officer, Urška Sršen, believes that analysing consumer data will unlock new opportunities for growth. Therefore, this project focuses on analysing smart device usage in order to gain insight into how people are using their smart devices.\n","\n","***I will be structuring this case-study using the six phases of the analysis process: Ask, Prepare, Process, Analyse, Share and Act.***"]},{"cell_type":"markdown","id":"d6ca55a3","metadata":{"_cell_guid":"bc2c29ed-938f-4e29-8a4a-c36fe715f0aa","_uuid":"9fd5d3a7-9c71-4200-804b-1fb9153a8014","papermill":{"duration":0.109881,"end_time":"2022-03-07T12:21:13.090695","exception":false,"start_time":"2022-03-07T12:21:12.980814","status":"completed"},"tags":[]},"source":["______________________________________________________________\n","\n","<a id=\"3\"></a>\n","## 1.0\tAct\n","\n","<a id=\"4\"></a>\n","### 1.1 Business Task Overview\n","\n","I will be focusing on garnering insight from FitBit Fitness Tracker Devices, to identify usage patterns and opportunities for growth for Bellabeat and their products.\n","\n","<a id=\"5\"></a>\n","### 1.2 Business Objectives\n","\n","I aim to answer the following questions:\n","\n","1.\tWhat are some trends in smart device usage? \n","2.\tHow could these trends apply to Bellabeat customers? \n","3.\tHow could these trends and insights influence Bellabeat marketing strategy and help drive business decisions?\n","\n","<a id=\"6\"></a>\n","### 1.3 Deliverables\n","\n","The following will be presented to stakeholders at the end of this project:\n","\n","1.\tA clear summary of the business task\n","2.\tA description of all data sources used \n","3.\tDocumentation of any cleaning or manipulation of data \n","4.\tA summary of the analysis \n","5.\tSupporting visualizations and key findings\n","6.\tHigh-level content recommendations based on the analysis\n","\n","<a id=\"7\"></a>\n","### 1.4 Key Stakeholders \n","\n","*  **Urška Sršen:** Bellabeat’s cofounder and Chief Creative Officer\n","*  **Sando Mur:** Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","*  **Bellabeat marketing analytics team:** A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.\n","_________________________________________"]},{"cell_type":"markdown","id":"f1f523a9","metadata":{"_cell_guid":"bc2c29ed-938f-4e29-8a4a-c36fe715f0aa","_uuid":"9fd5d3a7-9c71-4200-804b-1fb9153a8014","papermill":{"duration":0.111124,"end_time":"2022-03-07T12:21:13.312563","exception":false,"start_time":"2022-03-07T12:21:13.201439","status":"completed"},"tags":[]},"source":["<a id=\"8\"></a>\n","## 2.0 Prepare\n","\n","<a id=\"9\"></a>\n","### 2.1 Metadata\n","\n","*  The dataset, [Kaggle: FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit), is sourced from Kaggle, a public data platform. The data generated by thirty respondents to a distributed survey via Amazon Mechanical Turk between **2016-03-12** and **2016-05-12**.\n","*  Data is stored as 18 separate CSV files which can be viewed as a default long data format.\n","*  Explanation of column attributes and data collected can be found on the [Fitabase](https://www.fitabase.com/media/1930/fitabasedatadictionary102320.pdf) website.\n","\n","<a id=\"10\"></a>\n","### 2.2 Data Limitations\n","\n","*  **Reliability:** Data cannot be considered representative of the whole population. This is due to information being taken from only one retailer; a short data collection time period of one month; and a small sample size of thirty participants. These factors may affect the likelihood of bias. Data is pulled from different types of Fitbit trackers, which aren't stated, and individual tracking behaviors / preferences may influence the data. \n","*  **Originality:** Data is third party, collected by Amazon Mechanical Turk and distributed by Zenodo.\n","*  **Comprehensive:** The Data lacks basic useful parameters that may have helped identify trends. For example sex and age of participants are not present, and height and weight are also not documented for all participants.\n","*  **Current:** Data was pulled from 2016 and is therefore not up to date. \n","*  **Cited:** Data is fully cited as *Furberg, R., Brinton, J., Keating, M., & Ortiz, A. (2016). Crowd-sourced Fitbit datasets 03.12.2016-05.12.2016 [Data set]. Zenodo. [https://doi.org/10.5281/zenodo.53894](https://doi.org/10.5281/zenodo.53894)*\n","\n","<a id=\"11\"></a>\n","### 2.3 Data Ethics and Integrity \n","\n","*  Data for this case study will be handled in accordance with GDPR legislations.\n","*  Data is fully anonymous with no personal identifiable information.\n","_________________________________"]},{"cell_type":"markdown","id":"1e43cf3b","metadata":{"_cell_guid":"bc2c29ed-938f-4e29-8a4a-c36fe715f0aa","_uuid":"9fd5d3a7-9c71-4200-804b-1fb9153a8014","papermill":{"duration":0.111704,"end_time":"2022-03-07T12:21:13.533402","exception":false,"start_time":"2022-03-07T12:21:13.421698","status":"completed"},"tags":[]},"source":["<a id=\"12\"></a>\n","## 3.0 Process\n","\n","* We will be using R Studio as the primary tool for data cleaning, transforming and visualisation due to it's versitality. \n","\n","<a id=\"13\"></a>\n","### 3.1 Loading libraries in R"]},{"cell_type":"code","execution_count":1,"id":"930f50b7","metadata":{"_cell_guid":"b188d664-d322-4bdd-9e3a-1dcb9cdd6301","_kg_hide-output":true,"_uuid":"e8d8b644-9fd4-417c-8087-31da1cc50301","execution":{"iopub.execute_input":"2022-03-07T12:21:13.775702Z","iopub.status.busy":"2022-03-07T12:21:13.772801Z","iopub.status.idle":"202