pleted"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["     active      \n"," Min.   :  0.00  \n"," 1st Qu.:  0.00  \n"," Median : 27.00  \n"," Mean   : 38.37  \n"," 3rd Qu.: 61.00  \n"," Max.   :275.00  \n"]}],"source":["filtered_activity$active <- filtered_activity$very_active_minutes + filtered_activity$fairly_active_minutes\n","\n","activity_summary <- filtered_activity %>%\n","select(active) %>%\n","summary()\n","print(activity_summary)"]},{"cell_type":"markdown","id":"bdaad473","metadata":{"papermill":{"duration":0.175185,"end_time":"2022-03-07T12:21:25.428259","exception":false,"start_time":"2022-03-07T12:21:25.253074","status":"completed"},"tags":[]},"source":["*  The pie chart shows that on average, participants seem to spend most of their time sedentary, followed by lightly active, very active and then fairly active. \n","*  This may be due to the fact that a lot of people work in sedentary jobs, and generally spend most time sitting, but it is important to note that time spent sleeping is also included in it. \n","*  Lightly active could account for general walking.\n","*  Interestingly, the very active category is slightly larger than the fairly active category. A possible reason for this may be when people exercise, they may tend to push themselves further.\n","* Above, I have calculated that the mean time spent active per day is 38 mins. This is consistent with [CDC guidelines](https://www.cdc.gov/physicalactivity/basics/adults/) which recommends a minimum of 30 minutes of moderate intensity aerobic exercise a day.\n"]},{"cell_type":"markdown","id":"b05165dc","metadata":{"papermill":{"duration":0.174694,"end_time":"2022-03-07T12:21:25.777058","exception":false,"start_time":"2022-03-07T12:21:25.602364","status":"completed"},"tags":[]},"source":["<a id=\"20\"></a>\n","#### 4.1.2 Average Steps Per Day \n","\n","I will analyse the data to see which days people tend to be more active."]},{"cell_type":"code","execution_count":14,"id"