ine\n","\t1 & Sunday    & time\\_asleep & 452.7455\\\\\n","\t2 & Monday    & time\\_asleep & 419.5000\\\\\n","\t3 & Tuesday   & time\\_asleep & 404.5385\\\\\n","\t4 & Wednesday & time\\_asleep & 434.6818\\\\\n","\t5 & Thursday  & time\\_asleep & 401.2969\\\\\n","\t6 & Friday    & time\\_asleep & 405.4211\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 6 × 3\n","\n","| <!--/--> | day &lt;fct&gt; | variable &lt;fct&gt; | value &lt;dbl&gt; |\n","|---|---|---|---|\n","| 1 | Sunday    | time_asleep | 452.7455 |\n","| 2 | Monday    | time_asleep | 419.5000 |\n","| 3 | Tuesday   | time_asleep | 404.5385 |\n","| 4 | Wednesday | time_asleep | 434.6818 |\n","| 5 | Thursday  | time_asleep | 401.2969 |\n","| 6 | Friday    | time_asleep | 405.4211 |\n","\n"],"text/plain":["  day       variable    value   \n","1 Sunday    time_asleep 452.7455\n","2 Monday    time_asleep 419.5000\n","3 Tuesday   time_asleep 404.5385\n","4 Wednesday time_asleep 434.6818\n","5 Thursday  time_asleep 401.2969\n","6 Friday    time_asleep 405.4211"]},"metadata":{},"output_type":"display_data"}],"source":["# Average sleep data for each day\n","\n","sleep <- sleep_log %>%\n","group_by(day) %>%\n","dplyr::summarise( time_asleep = mean(total_minutes_asleep), time_in_bed = mean(total_time_in_bed)) \n","\n","#reorder days \n","sleep$day <- factor(sleep$day, levels= c(\"Sunday\", \"Monday\", \n","    \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))\n","sleep <- sleep[order(sleep$day), ]\n","\n","# Use reshape2 package to reorganise the data into a molten data frame so it is plottable\n","sleep2 <- melt(sleep, id.vars='day')\n","head(sleep2)\n"]},{"cell_type":"code","execution_count":30,"id":"904fda8e","metadata":{"execution":{"iopub.execute_input":"2022-03-07T12:21:41.382965Z","iopub.status.busy":"2022-03-07T12:21:41.381526Z","iopub.status.idle":"2022-03-07T12:21:41.600582Z","shell.execute_reply":"2022-03-07T12:21:41.599724Z"},"papermill":{"duration":0.441586,"end_time":"202